// Get the input data
const items = $input.all();

// Get the better_image value from the data field
const betterImage = items[0].json.data.better_image;
const foldername = items[0].json['Google Drive Folder Name']


// Get the URLs from the input
const url1 = items[0].json.url[0];
const url2 = items[0].json.url[1];

// Determine which URL to return based on better_image value
let selectedUrl;

if (betterImage === "Image 1") {
  selectedUrl = url1;
} else if (betterImage === "Image 2") {
  selectedUrl = url2;
} else {
  selectedUrl = "n/a";
}

// Return the result
return {
  json: {
    foldername: foldername,
    selected_url: selectedUrl,
    better_image: betterImage
  }
};

// Count total binary files across all input items
let totalFiles = 0;
for (const item of $input.all()) {
  const binaryData = item.binary;
  if (binaryData) {
    totalFiles += Object.keys(binaryData).length;
  }
}

// Calculate file 3 position (always total files + 1)
const file3Position = totalFiles + 1;

// Build the dynamic file references for "ring photos"
let fileReferences = '';
if (totalFiles === 1) {
  fileReferences = 'file 1';
} else if (totalFiles === 2) {
  fileReferences = 'file 1 and 2';
} else if (totalFiles > 2) {
  const fileNumbers = Array.from({length: totalFiles}, (_, i) => i + 1);
  const lastFile = fileNumbers.pop();
  fileReferences = 'file ' + fileNumbers.join(', ') + ', and ' + lastFile;
}

// Build the dynamic image references for "style of images"
let imageReferences = '';
if (totalFiles === 1) {
  imageReferences = 'image 1';
} else if (totalFiles === 2) {
  imageReferences = 'images 1 and 2';
} else if (totalFiles > 2) {
  const imageNumbers = Array.from({length: totalFiles}, (_, i) => i + 1);
  const lastImage = imageNumbers.pop();
  imageReferences = 'images ' + imageNumbers.join(', ') + ', and ' + lastImage;
}

// Get additional context from form input (note: lowercase 'c' in additionalcontext)
const additionalContext = $input.first().json.additionalcontext || '';

// Build base prompt
let prompt = `Convert the ring photos (${fileReferences}) into ONE clean pencil sketch viewed from above in the angle of the other files. Carefully observe and include EVERY visible element from the photos: center stone with all prongs, ALL side stones (including pear-shaped, round, or any accent stones), ALL small diamonds along the band or between stones, and the complete metal band structure. Use professional graphite drawing style with white paper background, simple shading to show metal band roundness, geometric facet lines on all gemstones, architectural jewelry technical illustration style, monochromatic grayscale, no added decorative elements`;

// Add additional context if it exists
if (additionalContext && additionalContext.trim() !== '') {
  prompt += `\n\nHere is additional context on the ring photos: ${additionalContext}`;
}

return { prompt };

const items = [];

for (const item of $input.all()) {
  // If you have multiple binary properties
  for (const [key, binary] of Object.entries(item.binary || {})) {
    items.push({
      json: {},
      binary: {
        data: binary  // Rename all to 'data'
      }
    });
  }
}

return items;

